import axisos from "axios"

const baseUrl = "/api/persons"


const getAll = () => {
  const request = axisos.get(baseUrl)
  return request.then(response => response.data)
}

const addNew = person => {
  const request = axisos.post(baseUrl, person)
  return request.then(response => response.data)
}


export default { getAll, addNew }
